//1.company C or D로 시작하는 회사중에, 풀네임이 10글자 넘는 사람들만 리스트로 나타내기
const q1 = data.filter((x) => {
  return (x.company.startsWith("C") || x.company.startsWith("D")) && x.fullName.length > 10;
});
console.log(q1);

//2. 타임존에서 대륙을 따로 분리해서 continent 키값만들고 value로 대륙넣고,
//   돈을 원화로 환산해서 다시 보여주기
const q2 = data.map((x) => {
  const [continent] = x.timeZone.split("/");
  x.continent = continent;
  x.money = +x.money.slice(1, x.money.length) * 1430;
  return x;
});
console.log(q2);

//3. 풀네임에서 성과 이름을 따로 분리하고, 타임존이 아시아인 사람들만 리스트화하고,
//  크레딧카드는 맨뒤에 4글자만 ****로 바꾸고 나타내기

const q3 = data
  .filter((x) => {
    return x.timeZone.includes("Asia");
  })
  .map((x) => {
    const [firstName, lastName] = x.fullName.split(" ");
    x.firstName = firstName;
    x.lastName = lastName;
    //"4508992616680630"
    x.creditcard = x.creditcard.slice(0, -5) + "****";
    return x;
  });

console.log(q3);
